import './App.css';
import Dictionary from "./Dictionary";

function App() {
  return (
    <div className="App">
      <div className="toggle ml-5">
      <div className="form-check form-switch">
        <input className="form-check-input" type="checkbox" id="flexSwitchCheckDefault"></input>
        <label className="form-check-label" for="flexSwitchCheckDefault">Dark/Light</label>
      </div>
      </div>
      <div className="container">
        <header className="text-center"><h1>Dictionary</h1></header>
        <Dictionary defaultWord="coffee" />
        <footer className="text-center mt-5"><small><a href="https://github.com/aligberg/dictionary-project">Open-sourced code</a> by Ali Greenberg</small></footer>
      </div>
    </div>
  );
}

export default App;
